const input = items[0].json;
const allEntries = Object.entries(input);
const chunkSize = 30;
const chunks = [];

for (let i = 0; i < allEntries.length; i += chunkSize) {
  const chunk = allEntries
    .slice(i, i + chunkSize)
    .map(([filename, caption]) => `${filename} – ${caption}`)
    .join("\n");

  chunks.push({
    json: {
      context: chunk,
      query: `You are a traffic enforcement AI reviewing image captions.

Each line contains an image filename and its caption. Identify any traffic violations.

Group violations into these categories:
- Bus Lane Blocking
- Illegal Parking
- Illegal Turns
- Other

Return a JSON object like this:
{
  "Bus Lane Blocking": ["video1_frame_317.jpg – Car blocking the bus lane"],
  "Illegal Parking": [],
  "Illegal Turns": [],
  "Other": []
}

⚠️ Important: Use the exact filenames provided (e.g., video1_frame_317.jpg). Do not change or rename them.`
    }
  });
}

return chunks;

let merged = {
  "Bus Lane Blocking": {},
  "Illegal Parking": {},
  "Illegal Turns": {},
  "Other": {}
};

for (const item of items) {
  const raw = item.json.message?.content || item.json.data?.message?.content || '{}';

  let parsed;
  try {
    parsed = JSON.parse(raw);
  } catch (e) {
    parsed = { "Error": ["⚠️ Unable to parse JSON from model response."] };
  }

  for (const [category, entries] of Object.entries(parsed)) {
    if (!merged[category]) merged[category] = {};

    for (const entry of entries) {
      const match = entry.match(/([\w\/\-\.]+\.jpg)\s*[–\-:]\s*(.+)/i);
      const fullPath = match?.[1]?.trim();
      const filename = fullPath?.split('/').pop() || "unknown.jpg";
      const description = match?.[2]?.trim() || "undefined";

      if (!merged[category][filename]) {
        merged[category][filename] = new Set();
      }
      merged[category][filename].add(description);
    }
  }
}

// Convert Sets to arrays
for (const category of Object.keys(merged)) {
  for (const filename of Object.keys(merged[category])) {
    merged[category][filename] = Array.from(merged[category][filename]);
  }
}

// Count and summarize
let totalViolations = 0;
const categoryCounts = {};
const fileCounts = {};

for (const [category, fileMap] of Object.entries(merged)) {
  let catCount = 0;
  for (const [filename, descriptions] of Object.entries(fileMap)) {
    const count = descriptions.length;
    catCount += count;
    fileCounts[filename] = (fileCounts[filename] || 0) + count;
  }
  categoryCounts[category] = catCount;
  totalViolations += catCount;
}

const topCategories = Object.entries(categoryCounts)
  .sort((a, b) => b[1] - a[1])
  .slice(0, 3)
  .map(([cat, count]) => `${cat} (${count})`)
  .join(', ');

const topFiles = Object.entries(fileCounts)
  .sort((a, b) => b[1] - a[1])
  .slice(0, 3)
  .map(([file, count]) => `• ${file} – ${count} violation${count > 1 ? 's' : ''}`)
  .join('\n');

const summary =
`🚨 *Traffic Violation Report Summary*
• Total Violations: ${totalViolations}
• Top Categories: ${topCategories}

🔥 Hotspots:
${topFiles}

📎 Attached: Full CSV Log of Violations`;

return [{
  json: {
    grouped_summary: summary,
    grouped_data: merged,
    total_violations: totalViolations
  }
}];

const groupedData = items[0].json.grouped_data;
const rows = [];

for (const [category, fileMap] of Object.entries(groupedData)) {
  for (const [filename, descriptions] of Object.entries(fileMap)) {
    for (const desc of descriptions) {
      rows.push(`"${filename}","${category}","${desc}"`);
    }
  }
}

const csv = `filename,category,description\n` + rows.join('\n');

return [{
  binary: {
    data: {
      data: Buffer.from(csv).toString('base64'),
      mimeType: 'text/csv',
      fileName: 'violations.csv',
    }
  }
}];
